import React, { Component } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import Build from './Build/Quooting';
import Mantain from './Mantain/Mantain';

class Quoting extends Component {
    constructor(props) {
        super(props);
        this.state = {
            menuOption: 0,
        };
    }

    renderContent() {
        switch (this.state.menuOption) {
            case 0:
                return (
                    <Mantain />
                );
                break;
            case 1:
                return (
                    <Build />
                );
                break;
        }
    }

    render () {
        return (
            <main className="site-main site-main-react page-spacing">
                <div className="container-fluid no-padding">
                    <div className="container">
                        <div className="section-header">
                            <Tabs className="tabContainer" selectedTabClassName="tab-selected" selectedIndex={this.state.step}>
                                <TabList>
                                    <Tab className="tabs">1</Tab>
                                    <Tab className="tabs">2</Tab>
                                </TabList>
                                <TabPanel>
                                </TabPanel>
                                <TabPanel>
                                </TabPanel>
                            </Tabs>
                        </div>
                        <div>
                            {this.renderContent()}
                        </div>
                    </div>
                </div>
            </main>
        );
    }
}

export default Quoting;
